import React from 'react';
import Icon from '@material-ui/core/Icon';
import '../../style/BtnPill.css';

const BtnPill = (props) => {
  return (
      <div id="btn-pill">
        <span className={props.bg}>
          <Icon className={props.icon}></Icon>
        </span>
        <span className="label">{props.label}</span>
      </div>
  )
}

export default BtnPill;
